import React from 'react';
import Task from '../task';

const TodoList = () => {
  return (
    <ul className="todo-list">
      <li className="completed">{Task}</li>
      <li className="editing">{Task}</li>
      <li>{Task}</li>
    </ul>
  );
};

export default TodoList;
